(1818, 8019, 'Irene Fredes cel.88061860', 0, 16, 1, 1, 5, 34, 4, 140, 250, 1, 600000, 1, 4, 3, 'Arriendo anual casa estilo mediterráneo en condominio tranquilo y seguro, sector reñaca detrás estadio español a pocos minutos del centro comercial y turístico de reñaca. La casa consta de 2 pisos. En su primer piso esta su living - comedor, cocina tradicional y equipada, sala de estar (que se puede utilizar como 5 dormitorio), logia, pieza de servicio con baño. En su 2 piso, consta de 3 dormitorios (principal en suite y walking closet), 2 baños y sala escritorio. Dispone de un amplío patio interior dando un total de terreno de 250 m2. El condominio cuenta con club house, piscina. Los gastos comunes son de $ 80.000 mil pesos y su arriendo es de $ 600.000 pesos mensuales. Interesados llamar a cel. 8 490 0096, con Alexis Saint-Laurence.', '0000-00-00', '0000-00-00', 'imagen-referencial.png', 'imagen-referencial.png', 'imagen-referencial.png', 'imagen-referencial.png', 1, 'general bulnes # 530, casa 5-A, con. terra verde.', 0, 0, 0, 1, '', 0, '', 0, ''),
