(1820, 8023, 'Patricia Zuñiga cel.81882446', 0, 7, 1, 2, 5, 34, 4, 50, 45, 1, 65000, 1, 2, 1, 'Se arrienda departamento diario, para capacidad de 4 personas en el centro de reñaca, a metros de la playa y comercio. El departamento cuenta con 2 dormitorios, 1 baño, cocina, living - comedor, terraza y estacionamiento. El edificio cuenta con piscina panorámica, sector de quinchos y sala de eventos. Interesados llamar a cel. 8 490 0096, con Alexis Saint-Laurence.', '0000-00-00', '0000-00-00', 'imagen-referencial.png', 'imagen-referencial.png', 'imagen-referencial.png', 'imagen-referencial.png', 1, 'avda. borgoño 14440, depto. 216, reñaca.', 0, 0, 0, 1, '', 0, '', 0, ''),
(1821, 8025, 'Gabriel Sanchez cel.62026462', 0, 12, 2, 1, 5, 33, 0, 200, 1250, 1, 152000000, 1, 5, 3, 'Se vende casa quinta sector parque los ingleses, de superficie 1.250 m2, la cual consta de 5 dormitorios (principal en suite), amplio living - comedor(con chimenea), cocina tradicional amoblada, sector para logia. La casa dispone de 3 jardines o patios interiores, uno de ellos con sector de quincho, árboles frutales y posibilidad de construcción de más propiedades. La casa cuenta con citófono con cámara y estacionamientos. Interesados llamar a cel. 8 490 0096, con Alexis Saint-Laurence.', '0000-00-00', '0000-00-00', 'imagen-referencial.png', 'imagen-referencial.png', 'imagen-referencial.png', 'imagen-referencial.png', 1, 'calle quinta los aromos, nº 40, valparaíso.', 0, 0, 0, 1, '', 0, '', 0, ''),
(1822, 8027, 'Mateo Sanchez', 0, 1, 1, 2, 5, 29, 75, 110, 1250, 1, 470000, 1, 3, 2, 'Se arrienda amplío departamento cerca de colegios, comercio y próximamente clínica. Consta de 3 dormitorios, principal en suite, 2 baños, living - comedor y cocina amoblada, su terraza al estar ubicado hacia el norte, recibe mañana y tarde los rayos solares, por lo que lo hacen muy iluminado y  temperado. El edificio cuenta con conserjería 24 hrs., piscina, sala Internet, sala multiuso, gimnasio, áreas verdes, y son solo 4 departamentos por piso, de un total de 12. Los gastos comunes son de $ 80.000 pesos. Interesados llamar al cel. 8 490 0096 con Alexis Saint-Laurence.', '0000-00-00', '0000-00-00', 'imagen-referencial.png', 'imagen-referencial.png', 'imagen-referencial.png', 'imagen-referencial.png', 1, 'gaston hamel 585, dpto. 1101. bosque de montemar.', 0, 0, 0, 1, '', 0, '', 0, ''),
(1823, 8029, 'Gustavo Mesa cel.74999796', 0, 10, 1, 1, 5, 34, 5, 120, 200, 1, 530000, 1, 3, 2, 'Se arrienda casa nueva en $ 530.000 pesos condominio tranquilo y seguro, consta de 3 dormitorios (principal en suite ), 2 baños, pequeña sala escritorio, cocina amplía, living-comedor.  Patio interior de buen tamaño en perfectas condiciones y dispone para 2 estacionamientos. Los gtos. comunes son de $ 50.000 pesos. Interesados llamar a cel. 8 490 0096, con Alexis Saint-Laurence. Fotos en el siguiente link: http://www.yapo.cl/valparaiso/casas/casa_en_condominio_200_m2_jardin_del_mar_16386427.htm', '0000-00-00', '0000-00-00', 'imagen-referencial.png', 'imagen-referencial.png', 'imagen-referencial.png', 'imagen-referencial.png', 1, 'cond. brisas del mar II, jardín del mar.', 0, 0, 0, 1, '', 0, '', 0, ''),
(1824, 8031, 'Leonel Jerez cel. 91787033', 0, 2, 2, 9, 5, 34, 4, 120, 800, 1, 110000000, 1, 0, 2, 'Se vende terreno de 800 m2 sector sub. los ositos, especial para inmobiliaria o constructora. Interesados llamar a cel. 8 490 0096, con Alexis Saint-Laurence.', '0000-00-00', '0000-00-00', 'imagen-referencial.png', 'imagen-referencial.png', 'imagen-referencial.png', 'imagen-referencial.png', 1, 'sub. angamos con ositos.', 0, 0, 0, 1, '', 0, '', 0, ''),
(1825, 8033, 'Ubaldo Moraga', 0, 2, 1, 2, 5, 29, 75, 110, 800, 1, 600000, 1, 3, 2, 'Arriendo anual de departamento amoblado en $ 600.000 en séptimo piso, más gastos comunes de $ 80.000 pesos,  con hermosa vista hacia la bahía de viña del mar. Consta de 3 amplios dormitorios, principal en suite, 2 baños, living-comedor, cocina y terraza. La cocina viene con lavadora y secadora y comedor diario. El arriendo incluye 1 estacionamiento y 1 bodega. Los servicios del edificio son, piscina, sala multimedia, sala de reuniones, gimnasio, pequeño sector de áreas verdes y conserjería las 24 horas. Interesados llamar al cel. 8 490 0096, con Alexis Saint-Laurence.', '0000-00-00', '0000-00-00', 'imagen-referencial.png', 'imagen-referencial.png', 'imagen-referencial.png', 'imagen-referencial.png', 1, 'contacto sra cecilia cel 76217126', 0, 0, 0, 1, '', 0, '', 0, ''),
(1826, 8035, 'Maria paz bezanilla', 0, 1, 1, 1, 5, 29, 0, 160, 180, 1, 670000, 1, 5, 3, 'Hermosa casa de 3 niveles en arriendo anual, a 3 cuadras de colegio st margaret, y en plena avenida principal. Amplios espacios, 5 dormitorios, (incluye pieza de servicio), sector de loggia, gran e iluminada cocina, 3 baños, living comedor por separados y mansarda. Además consta de sector de piscina, quincho y estacionamiento. La casa tiene alrededor de 160 m2. Interesados contactarse al cel. 8 490 0096, con Alexis Saint-Laurence.', '0000-00-00', '0000-00-00', 'imagen-referencial.png', 'imagen-referencial.png', 'imagen-referencial.png', 'imagen-referencial.png', 1, 'avda blanca estela con st margaret', 0, 0, 0, 1, '', 0, '', 0, ''),
(1827, 8037, 'Juan Carlos Fontecilla', 0, 1, 1, 1, 5, 34, 4, 190, 480, 1, 700000, 1, 5, 3, 'Se arrienda casa en $ 700. 000 pesos en tranquilo sector de reñaca, muy soleada y de excelente ambiente. Consta de 3 dormitorios (principal en suite), el 4 dormitorio se puede utilizar como pieza de trabajo, o pieza de juegos, pc, etc. Tiene un 5 dormitorio que es utilizado como pieza de servicio. La casa tiene un patio interior soleado y patio exterior. Consta de alarma y portón electrónico. Estacionamiento para 3 a 4 automóviles. Interesados llamar a cel 9673 6137 con Alexis Saint-Laurence. Superficie Útil 190 m2 Superficie Total 480 m2', '0000-00-00', '0000-00-00', 'imagen-referencial.png', 'imagen-referencial.png', 'imagen-referencial.png', 'imagen-referencial.png', 1, 'conctacto: 98025188 calle balmaceda 1444-d', 0, 0, 0, 1, '', 0, '', 0, ''),
(1828, 8039, 'Mauricio Rachid cel. 9005 0782', 0, 1, 2, 1, 5, 34, 5, 131, 285, 1, 165000000, 1, 5, 3, 'Se vende hermosa casa en condominio sector jardín del mar. La casa esta nueva prácticamente. Consta de 5 dormitorios (principal en suite), 3 baños, amplío living y comedor por separados. La casa es independiente (no pareada) pero esta rodeada de otras propiedades, lo que permite que sea más segura para sus propietarios. Tiene estacionamiento para 2 vehículos, pasto con riego automático, termo paneles en todas sus ventanas, asoleada y portería las 24 horas del día. Los gastos comunes no superan los $ 80.000 pesos. Se puede visitar de lunes a viernes solo por las tardes. Reales interesados llamar al cel. 8 490 0096 con alexis saint laurence.', '0000-00-00', '0000-00-00', 'imagen-referencial.png', 'imagen-referencial.png', 'imagen-referencial.png', 'imagen-referencial.png', 1, 'condominio brisa marina 2. jardín del mar.', 0, 0, 0, 1, '', 0, '', 0, '');
