(3, 'Curauma', 5, 33, 'Arlegui 1109, oficina 46', '32 346 6785', ' +569 9673 6137', 'curauma@mateosanchez.cl', 'Alexis Saint Laurence', '82592056', 'El sector de Curauma ha alcanzado un desarrollo inmobiliario muy importante dentro de la comuna de ValparaÃ­so , en poco tiempo  esta importante zona urbana se ha transformado en una pequeÃ±a ciudad satÃ©lite , actualmente cuenta con grandes supermercados, tiendas de conveniencia y un gran futuro a corto y mediano plazo<br />\r\n<br />\r\nPor estos motivos es que MATEO SANCHEZ PROPIEDADES en su afÃ¡n de expansiÃ³n a logrado posicionarse en un mercado objetivo local.<br />\r\n<br />\r\nSi necesitan de nuestros servicios profesionales les ruego tomar contacto a travÃ©s de nuestros agentes de cada sucursal  que aparecen destacados al pie de esta pÃ¡gina.<br />\r\n<br />\r\nAgradeciendo de antemano su atenciÃ³n.<br />\r\n<br />\r\nMATEO SANCHEZ PROPIEDADES.', 0, 'franquicia-2c4c8b429cb705d4.jpg'),
(4, 'ReÃ±aca', 5, 34, 'Arlegui 1109, oficina 46', '', '+569 42445133', 'litty.kuschel@mateosanchez.cl', 'Litty Kuschel', '+569 42445133', 'Creemos que nuestra atenciÃ³n, cordialidad y preocupaciÃ³n nos caracteriza , contamos con una amplia cartera de propiedades habitacionales y destacados proyectos inmobiliarios, nuestro campo de acciÃ³n abarca las zonas de ReÃ±aca,  Concon,  Mantagua, Quintero y alrededores, conozcanos y recomiende nuestra excelente atenciÃ³n. Los invito a ingresar a nuestra pÃ¡gina web www.mateosanchez.cl o bien al telÃ©fono +56 9 42 44 51 33. Para mayor informaciÃ³n tomar contacto con litty.kuschel@mateosanchez.cl<br />\r\n<br />\r\nLos Esperamos', 1, 'franquicia-2d1d721878ca1086.jpg');
